import React, { useState, useEffect, useRef } from 'react';
import { Link } from 'react-router-dom';
import logo from '../Images/logo.png';

const Navbar = () => {
  const [isDropdownOpen, setIsDropdownOpen] = useState(false);
  const dropdownRef = useRef(null);

  useEffect(() => {
    const handleClickOutside = (event) => {
      if (dropdownRef.current && !dropdownRef.current.contains(event.target)) {
        setIsDropdownOpen(false);
      }
    };

    if (isDropdownOpen) {
      document.addEventListener('mousedown', handleClickOutside);
    }

    return () => {
      document.removeEventListener('mousedown', handleClickOutside);
    };
  }, [isDropdownOpen]);

  return (
    <header className="absolute top-0 left-0 right-0 z-20" style={{backgroundColor: 'transparent'}}>
      <div className="container mx-auto flex items-center justify-between py-6 px-4" style={{maxWidth: '1200px', margin: '0 auto', display: 'flex', alignItems: 'center', justifyContent: 'space-between'}}>
        <Link to="/" style={{textDecoration: 'none'}}>
          <img src={logo} alt="MOE" className="h-16 w-auto" />
        </Link>
        <nav className="flex items-center gap-8">
          <a href="#top" className="text-white hover:text-gray-200 font-medium uppercase tracking-wide">HOME</a>
          <div className="relative" ref={dropdownRef}>
            <button 
              onClick={(e) => {
                e.preventDefault();
                e.stopPropagation();
                console.log('PROJECTS clicked!', isDropdownOpen);
                setIsDropdownOpen(!isDropdownOpen);
              }}
              className="text-white hover:text-gray-200 font-medium uppercase tracking-wide cursor-pointer"
              style={{
                background: 'none',
                border: 'none',
                padding: '8px 12px',
                cursor: 'pointer',
                fontSize: 'inherit',
                fontFamily: 'inherit',
                outline: 'none'
              }}
            >
              PROJECTS {isDropdownOpen ? '▼' : '▶'}
            </button>
            {isDropdownOpen && (
              <div 
                style={{
                  position: 'absolute',
                  top: '100%',
                  left: '0',
                  zIndex: 9999,
                  backgroundColor: 'white',
                  border: '1px solid #e5e7eb',
                  borderRadius: '8px',
                  boxShadow: '0 10px 15px -3px rgba(0, 0, 0, 0.1), 0 4px 6px -2px rgba(0, 0, 0, 0.05)',
                  padding: '8px 0',
                  minWidth: '200px',
                  marginTop: '8px'
                }}
                onClick={(e) => e.stopPropagation()}
              >
                <div 
                  style={{
                    padding: '8px 16px',
                    fontSize: '14px',
                    color: '#374151',
                    cursor: 'pointer',
                    borderBottom: '1px solid #f3f4f6'
                  }}
                  onMouseEnter={(e) => e.target.style.backgroundColor = '#f9fafb'}
                  onMouseLeave={(e) => e.target.style.backgroundColor = 'white'}
                  onClick={() => setIsDropdownOpen(false)}
                >
                  RESIDENTIAL
                </div>
                <div 
                  style={{
                    padding: '8px 16px',
                    fontSize: '14px',
                    color: '#374151',
                    cursor: 'pointer',
                    borderBottom: '1px solid #f3f4f6'
                  }}
                  onMouseEnter={(e) => e.target.style.backgroundColor = '#f9fafb'}
                  onMouseLeave={(e) => e.target.style.backgroundColor = 'white'}
                  onClick={() => setIsDropdownOpen(false)}
                >
                  COMMERCIAL
                </div>
                <div 
                  style={{
                    padding: '8px 16px',
                    fontSize: '14px',
                    color: '#374151',
                    cursor: 'pointer',
                    borderBottom: '1px solid #f3f4f6'
                  }}
                  onMouseEnter={(e) => e.target.style.backgroundColor = '#f9fafb'}
                  onMouseLeave={(e) => e.target.style.backgroundColor = 'white'}
                  onClick={() => setIsDropdownOpen(false)}
                >
                  SCHOOL
                </div>
                <div 
                  style={{
                    padding: '8px 16px',
                    fontSize: '14px',
                    color: '#374151',
                    cursor: 'pointer'
                  }}
                  onMouseEnter={(e) => e.target.style.backgroundColor = '#f9fafb'}
                  onMouseLeave={(e) => e.target.style.backgroundColor = 'white'}
                  onClick={() => setIsDropdownOpen(false)}
                >
                  INTERIOR DESIGN
                </div>
              </div>
            )}
          </div>
          <a 
            href="#about" 
            className="text-white hover:text-gray-200 font-medium uppercase tracking-wide"
            onClick={(e) => {
              e.preventDefault();
              document.getElementById('about')?.scrollIntoView({ behavior: 'smooth' });
            }}
          >
            ABOUT
          </a>
          <a 
            href="#contact" 
            className="text-white hover:text-gray-200 font-medium uppercase tracking-wide"
            onClick={(e) => {
              e.preventDefault();
              document.getElementById('contact')?.scrollIntoView({ behavior: 'smooth' });
            }}
          >
            CONTACT
          </a>
        </nav>
        <div className="w-16"></div>
      </div>
    </header>
  );
};

export default Navbar;
